import React, { Component } from "react";
import Main from "./components/main";
import { Provider } from "./components/Context";

export class App extends Component {
  render() {
    const text = ['I used Context f', 'or this example'] 
    return (
      <div>
        <Provider value={text} >
          <Main />
        </Provider>
      </div>
    );
  }
}

export default App;
